void setup()
{
  size( 300, 500 );
  fill( 0 );
  stroke( 255 );
}

void draw()
{
  background( 0 );

  for ( int y = 100; y < 400; y += 5 ) {
    beginShape();
    for ( int x = 0; x < 310; ++x ) {
      float n = noise( x/30.0 + frameCount/50.0 + y);
      vertex( x, y - 80.0 / (1.0 + pow(x-150.0, 4) / 8.0e6) * n);
    }
    vertex( 310, 1000 );
    vertex( 0, 1000 );

    endShape();
  }
}
